&quot;Allocate\\logseq____&quot; som finder sted hvert år.\\nEn af byens ældre vælger ud fra opvækst og opførsel et individ som skal allokeres som betyder man skal ud på en rejse med en af de voksne mentorer.\\n\\nDette år blev Amie valgt og skulle have [[Osty]] som mentor.\\nDe tog op mod bjergene og årene gik.\\n\\nAmie fik sit første sjæle-bånd, til et flyveegern som fik navnet [[Oliver]] \\nOliver blev brugt til at holde kontakten til Amielogseq____&apos;s forældre imens hun blev allokeret.\\nDa Amie fylder 20 år er hun nu færdig med sin allokering og en del er sket på de bare 2 år.\\n\\nAmie brugte et år efterfølgende på at være spion og var dygtig til det.\\nDer var ikke nogen som endnu har opdaget eller fundet ud af at Amie er spion.\\nOliver bringer ordre tilbage til Amie og svaret bliver returneret via Oliver. Underligt nok kom Oliver altid tilbage med en eller anden form for mad/snack\\nDe er det perfekte makkerpar.\\n\\nEn dag beslutter hun sig for at blive en del af det brændende svær i håb om at finde ud af hvorfor [[Osty]] forsvandt - ingen ved hvordan dette kommer til at ende.logseq____&quot;,536870978]],[logseq____&quot;^15logseq____&quot;,[1098,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536870978]],[logseq____&quot;^15logseq____&quot;,[1098,logseq____&quot;^Flogseq____&quot;,1091,536870978]],[logseq____&quot;^15logseq____&quot;,[1098,logseq____&quot;^Xlogseq____&quot;,410,536870978]],[logseq____&quot;^15logseq____&quot;,[1098,logseq____&quot;^Vlogseq____&quot;,410,536870978]],[logseq____&quot;^15logseq____&quot;,[1098,logseq____&quot;^Ulogseq____&quot;,410,536870978]],[logseq____&quot;^15logseq____&quot;,[1098,logseq____&quot;^Ulogseq____&quot;,411,536870978]],[logseq____&quot;^15logseq____&quot;,[1098,logseq____&quot;^Ulogseq____&quot;,552,536870978]],[logseq____&quot;^15logseq____&quot;,[1098,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Elogseq____&quot;,3],536870978]],[logseq en som sidder hjemme i skjulet stadig er i live. \\nDerfor har han besluttet sig for at vende tilbage til sine evner som spion/agent og forhåbentligt gøre en forskel ved at gå efter mere strategiske mål som har indflydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Flogseq____&quot;,1437,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Xlogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Vlogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Ulogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Elogseq____&quot;,3],536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Jlogseq____&quot;,[],536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Hlogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66c778f7-b742-49f0-8ca0-ccfd48017deblogseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1440,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Is a follower of #[[Cyrai - The laughing god]]logseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1440,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1440,logseq____&quot;^Flogseq____&quot;,1445,536871044]],[logseq____&quot;^15logseq____&quot;,[1440,logseq____&quot;^Xlogseq____&quot;,21,536871044]],[logseq____&quot;^  <script type="text/javascript">// Single Page Apps for GitHub Pages

      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
